import React, {Component} from 'react';
import { connect } from 'react-redux';
/* import { getMyPokemonList } from '../../store/actions' */
import { ListItem } from '../../components/organisms';

class MyPokemonList extends Component {
    state = {
        myPokemon: []
    }

    render(){   
        return (
            <ListItem
                from="owned"
                failed={false}
                isLoading={this.props.isLoading}
                list={this.props.myPokemon} />
        )
    }

}

const mapStateToProps = (state)=>({
  myPokemon: state.pokemon.myPokemon,
  isLoading: state.pokemon.isLoading,
}) 

export default connect(mapStateToProps)(MyPokemonList)
